import React from 'react';
import styled from 'styled-components';

const DashboardContainer = styled.div`
  padding: 2rem;
  text-align: center;
  background-color: var(--color-bg-primary);
  min-height: 100vh;
`;

const Title = styled.h1`
  color: white;
  margin-bottom: 1rem;
  font-size: 2.5rem;
`;

const Subtitle = styled.p`
  color: #B4B4C6;
  margin-bottom: 2rem;
`;

const Card = styled.div`
  background-color: #252535;
  border-radius: 8px;
  padding: 1.5rem;
  margin: 0 auto;
  max-width: 800px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const Dashboard: React.FC = () => {
  return (
    <DashboardContainer>
      <Title>Odd Genius</Title>
      <Subtitle>Soccer Betting Analytics Platform</Subtitle>
      <Card>
        <h2 style={{ color: 'white', marginBottom: '1rem' }}>Welcome to the Dashboard</h2>
        <p style={{ color: '#B4B4C6' }}>
          This is a simplified version of the dashboard. The full version will include match data, 
          betting odds, analytics, and more.
        </p>
      </Card>
    </DashboardContainer>
  );
};

export default Dashboard;
